import Link from 'next/link';
import React, { useState } from 'react';
import {
  Collapse,
  Navbar,
  Form,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavLink,
  NavItem,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem,
  NavbarText
} from 'reactstrap';
import PropTypes from 'prop-types'

const linkStyle = {
  marginRight: 15
};

const Header = () => (

  <div>
    <html>
    <Navbar expand="lg" bg="dark" variant="dark">
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
    </Link>
    </Navbar>
    </html>
  </div>
);


